When in a new place with the desire to see new things, the first step is typically to gather information about the area. This could involve seeking recommendations for interesting places to visit, which aligns with option A) interesting. Next, one might physically explore the area, possibly on foot, to get a feel for the environment, corresponding with option B) look around.

While exploring, capturing memories through photographs is common, aligning with option C) take pictures. The motivation behind seeking out new sights often involves a desire for a change of atmosphere or surroundings, as indicated by option D) change of surroundings. Lastly, the entire process is driven by the aim to have a novel and enriching experience, making option E) new experience relevant.

In considering these aspects step by step:
1. Seek interesting locations or recommendations {A}
2. Look around and explore the area {B}
3. Take pictures if desired to document the experience {C}
4. Note the change of surroundings as part of the exploration {D}
5. Appreciate the new experience this exploration offers {E}

The overarching goal in seeing new things is to have a new experience, so while all options are relevant steps, the final answer focusing on the core goal is {E} new experience.
